nat2float :: Prelude.Integer -> Floats.Coq_float
nat2float n =
  (\fO fS n -> if n Prelude.== 0 then fO () else fS (n Prelude.- 1))
    (\_ -> Floats._Float__zero)
    (\k -> Floats._Float__add (nat2float k) one)
    n

rational2float :: Prelude.Integer -> Prelude.Integer -> Floats.Coq_float
rational2float n d =
  Floats._Float__div (nat2float n) (nat2float d)

